import {getPeopleInfo} from "../../utils/api";


const initialState = {
    userInfo: {},
    partInfo: {},
    listOfResearcher: [],
    listOfAdmins: [],
    isDisableButtons:true
};

const MainReducer = (state = initialState, action) => {
    switch (action.type) {

        default:
            return state;
    }
};
export const getPeople = () => dispatch => {
    getPeopleInfo()
        .then( item => {
            dispatch(people(item.data.results));
        })
    dispatch(Loading(false));
}
export default MainReducer;
